import axios from "axios";
import GET_ITEMS from "../actionType";

const getItems = () => {
  axios(
    "https://run.mocky.io/v3/9d71cb03-a9f9-4d70-bae2-9d3adaa1cfe7k",
    {}
  ).then((res) => {
    console.log(res);
    return {
      type: GET_ITEMS,
      payload: res.data,
    };
  });
};
export default getItems;
